import { BrowserRouter as Link } from "react-router-dom";

function EventCard({ event: {id, name, date, time, info_for_participants, image} }) {
  return (
    
    <div class="min-h-min flex items-center mx-auto justify-center p-10">
      {/* <Link to={`/events/${id}`} /> only works in react v5 */}
      <div class=" w-80 bg-white rounded-xl overflow-hidden shadow-lg hover:shadow-xl hover:scale-105 duration-500 transform transition cursor-pointer">
        <img src={image} alt=""/>
        <div class="p-5">
          <h1 class="text-xl font-bold">{name}</h1>
          <p class="mt-2 text-md font-semibold text-gray-600">Date: {date}</p>
          <p class="mt-2 text-md font-semibold text-gray-600">Time: {time}</p>
          <p class="mt-1 text-gray-500 font-">{info_for_participants}</p>
        </div>
      </div> 
    </div>
  );
}
export default EventCard;
